  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108152 includes chemical,
  discrete sample, physical and profile data collected from MIRAI in the North Pacific
  Ocean from 2001-07-23 to 2001-08-28 and retrieved during cruise CLIVAR_P17N_2001.
  These data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113
  (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), DELTA CARBON-13, DELTA CARBON-14, DISSOLVED
  INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE,
  Potential temperature (theta), SALINITY, SILICATE, WATER TEMPERATURE and pH. The
  instruments used to collect these data include Alkalinity titrator, CTD, Coulometer
  for DIC measurement, bottle and pH meter. These data were collected by Akihiko Murata
  of Japan Agency for Marine-Earth Science and Technology (JAMSTEC) and Masao Fukasawa
  of Japan Agency for Marine-Earth Science and Technology (JAMSTEC); Mutsu Institute
  for Oceanography; Ocean Observation and Research Department as part of the CLIVAR_P17N_2001
  data set.nnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
  carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
